import React from "react";

interface Props {
  courseName: string;
  id: string;
  onMouseOver: () => void;
}
const GeneralRequirements = ({ courseName, id, onMouseOver }: Props) => {
  return (
    <button className="circle" id={id}>
      {courseName}
    </button>
  );
};

export default GeneralRequirements;
